import React, { useState } from 'react';
import { useLocation, useNavigate } from "react-router-dom";
import Sidebar from '../Sidebar';
import { Nav } from 'react-bootstrap';
import Navbar from '../NavBar';
import { useEffect } from 'react';

export default function Listing() {
    const { state }  = useLocation();
    const { cart } = state;
    
    const [myCart, setMyCart] = useState(cart);
    const navigate = useNavigate();
    let base64Data = ""
    
    let sizes = ['S', 'M', 'L'];

    const addToCart = (e) => {
        e.preventDefault();
        const newCart = myCart.concat(1);
        setMyCart(newCart);
    }

    const [size, setSize] = useState('S');
    return <div>
        <Sidebar></Sidebar>
        <Navbar cart={myCart}></Navbar>
        <div className='listing'>
        <div style={{padding: "5%"}}>
        <img src={`data:image;base64,${base64Data}`} />
        </div>
        
        <selection>
            <h1>tommy hilfger</h1>
            <h2>HILFIGER MONOTYPE COLLEGE LOGO T-SHIRT</h2>
            <h3>$39.00</h3>
            <p>size : {size}</p>
            {sizes.map((size) => {
                return <button className='button sizeButton' value={size} onClick={(e) => setSize(e.target.value)}>{size}</button>
            })}
            <br></br>
            <button className='button addToCartButton' onClick={addToCart}>Add To Cart</button>
        </selection>

    </div>
    </div>
    
  }